var prtgchart, currentrequest;
var getData = function () {
    var start = jquery("#demodateselector").data("daterangepicker") != null ? jquery("#demodateselector").data("daterangepicker").startDate.format("YYYYMMDDHHmmss") : null,
        end = jquery("#demodateselector").data("daterangepicker") != null ? jquery("#demodateselector").data("daterangepicker").endDate.format("YYYYMMDDHHmmss") : null,
        intv = jquery("#demointerval").val(),
        group = jquery("#demogroupselect").val(),
        gname = jquery("#demogroupselect option:selected").text(),
        path = group!=null && start!=null && end!=null && intv!=null ? "https://atv-webhvac01.bucees.local/api/series/" + group + "/" + encodeURIComponent(start) + "/" + encodeURIComponent(end) + "/" + encodeURIComponent(intv) : "https://atv-webhvac01.bucees.local/api/series";
    jquery('#demogroupselect').after("<i id='spinner' style='font-size: 19px;margin: 7px;' class='fa fa-cog fa-spin'></i>");
    // console.log(startdate,enddate,ranges);
    currentrequest = jquery.getJSON(path, function (data) {
        //Initialize Highcharts
        prtgchart = Highcharts.chart("chartcontent", {
            chart: {
                zoomType: "x",
                events: {
                    load: function () { 
                        $('#spinner').remove();
                    }
                }
            },
            title: {
                text: gname
            },
            subtitle: {
                text: void 0 === document.ontouchstart ? "Click and drag in the plot area to zoom in. Click a line on the graph to only show that line." : "Pinch the chart to zoom in"
            },
            xAxis: {
                type: "datetime"
            },
            yAxis: {
                title: {
                    text: "Temperature"
                }
            },
            legend: {
                enabled: !0
            },
            plotOptions: {
                series: {
                    events: {
                        click: function(e) {
                            for (i = 0; i<prtgchart.series.length;i++) {
                                if (i==this.index) continue;
                                prtgchart.series[i].setVisible(false,false);
                            }
                            prtgchart.redraw();
                            console.log(e);
                        }
                    }
                }
            },
            series: data
        })
    })
},

runStart = function () {
    jquery.getJSON("https://atv-webhvac01.bucees.local/api/groups", function (groups) {
        var options = "";
        for (i = 0; i<groups.length;i++)
        {
            options += "<option value='" + groups[i].storeid + "' " + (i==0 ? "selected=''" : "") + ">" + groups[i].storeid + "</option>";
        }
        jquery("#demogroupselect").html(options);

        var ranges = {
            'Today': [prtgmoment().startOf('day'), prtgmoment()],
            'Yesterday': [prtgmoment().subtract(1, 'days').startOf('day'), prtgmoment().subtract(1, 'days').endOf('day')],
            'Last 10 Days': [prtgmoment().subtract(9, 'days').startOf('day'), prtgmoment()],
            'Last 30 Days': [prtgmoment().subtract(29, 'days').startOf('day'), prtgmoment()],
            'This Month': [prtgmoment().startOf('month').startOf('day'), prtgmoment().endOf('month')],
            'Last Month': [prtgmoment().subtract(1, 'month').startOf('month').startOf('day'), prtgmoment().subtract(1, 'month').endOf('month').endOf('day')],
            'Last 3 Months': [prtgmoment().subtract(2, 'month').startOf('month').startOf('day'), prtgmoment().endOf('month')],
            'Last 6 Months': [prtgmoment().subtract(5, 'month').startOf('month').startOf('day'), prtgmoment().endOf('month')]
        },
        startdate = prtgmoment().subtract(9, 'days').startOf('day'),
        enddate = prtgmoment();
        //set daterangeselector default dates and interval
        if (jquery('#demodateselector').data('daterangepicker')==null) {
            jquery('#demodateselector').daterangepicker({
                startDate: startdate,
                endDate: enddate,
                timePicker: true,
                ranges: ranges
            }, function (s, e, l) {
                getData();
            });
        }
        getData();
    });
    $(document).on('click','#selectall',function(e) { e.preventDefault(); for (i=0; i<prtgchart.series.length; i++) { prtgchart.series[i].setVisible(true,false); } prtgchart.redraw(); })
        .on('click','#selectnone',function(e) { e.preventDefault(); for (i=0; i<prtgchart.series.length; i++) { prtgchart.series[i].setVisible(false,false); } prtgchart.redraw(); })
        .on('click','#spinner', function() { currentrequest.abort(); $('#spinner').remove(); })
        .on('change','#demointerval', function() { getData(); })
        .on('change','#demogroupselect', function() { getData(); });
};

runStart();